svg.script:
var diagramGroup = Snap.select('#Layer_1');
var icons = {};
var iconNames = ['twitter', 'whatsapp'];
diagramGroup.select('#whatsapp-screen').attr({opacity: 0});
for(var i=0;i<iconNames.length;i++)
  icons[iconNames[i]] = diagramGroup.select('#' + iconNames[i]);
var changeColor = function(id){
  for(var i=0;i<iconNames.length;i++){
    diagramGroup.select('#' + iconNames[i]+'-icon').attr({fill: '#58595b'});
    diagramGroup.select('#' + iconNames[i]+'-circle').attr({stroke: '#6d6e71'});
    diagramGroup.select('#' + iconNames[i]+'-screen').attr({opacity: 0});
    diagramGroup.select('#' + iconNames[i]+'-circumference').attr({stroke: '#cccccc'})
  }
  diagramGroup.select('#' + id+'-circumference').attr({stroke: '#1aa871'})
  diagramGroup.select('#' + id+'-icon').attr({fill: '#1aa781'});
  diagramGroup.select('#' + id+'-circle').attr({stroke: '#1aa781'});
  diagramGroup.select('#' + id+'-screen').attr({opacity: 1});
  if(id=='whatsapp'){
    diagramGroup.select('#textSpan').attr({x: 355});
    document.getElementById('processType').textContent = 'BUILD A';
    document.getElementById('appName').textContent = '  CHAT APP  ';
    document.getElementById('processName').textContent = 'IN 4 SIMPLE STEPS';
  }
  else{
    diagramGroup.select('#textSpan').attr({x: 423});
    document.getElementById('processType').textContent = 'LIVE';
    document.getElementById('appName').textContent = '  TWITTER  ';
    document.getElementById('processName').textContent = 'DEMO';
  }
}
var changePage = function(){
      switch(document.getElementById('appName').textContent.trim()) {
            case 'TWITTER':  window.top.location.href = "///twitter.appbase.io"; break;
            case 'CHAT APP': window.top.location.href = "/tutorial.html"; break;
      }
}
changeColor('whatsapp');
